STEWART LEE ? STAND-UP COMEDIAN

Stewart Graham Lee (born April 5, 1968 in Shropshire, raised in Solihull) is an English stand-up comedian, writer and director probably best known for being one half of the 1990s comedy duo Lee and Herring, and for co-writing and directing the critically-acclaimed and controversial stage show Jerry Springer - The Opera. He grew up in the West Midlands, where he attended Solihull School, an Independent school dating back to 1560. He is married to fellow comic Bridget Christie [1]. He is a Distinguished Supporter of the British Humanist Association.

